import axios from "axios";

export default function getcallfunction() {
  axios
    .get("http://localhost:4000/videos/-4022-434e-80bf-000ce4cd12b8")
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      console.log(err);
    });
}
